  false,\n\t\"url\": null,\n\t\"notes\": \"Scope: National.  NPS Focus Digital Library
  and Research Station information system manages images and archives of images as
  well as documents described by linked metadata and provides cross-repository searching
  of library catalogs within and external to the NPS.  The NPS Focus system is composed
  of two separate but integrated subsystems: * The NPS Focus Digital Library is a
  digital resource metadata and file management system. It can be used to store images
  and documents for search and display through the NPS Focus GUI or as a web service
  to other systems. * NPS Focus Research Station provides a portal to search across
  numerous NPS systems including its own digital library of images and documents.
